import '../css/NurPatientList.css';
import { useContext } from 'react';
import Common from './Common';
import React, {useEffect, useState} from 'react';
import axios from 'axios';
import UserContext from './UseContext';
import { url } from '../config';
import { useSetAtom } from 'jotai';
import { accessTokenAtom, usernameAtom} from '../config/Atom.js';
const NurPatientList = () => {
    // 1. 상태에 따라 환자 리스트가 다르게 보임
    // 2. 입원한 환자 리스트 가져오기 (admission table)
    const [fetched, setFetched] = useState(false); // 데이터를 이미 가져왔는지 여부를 나타내는 상태 변수
    const [admList,setAdmList] = useState([]);

    useEffect(()=>{
        // const username = sessionStorage.getItem('username');
        // console.log(`${url}/wardPatientList?nurNum=${username}`);
        // axios.get(`${url}/wardPatientList?nurNum=${username}`)
        // .then(response=>{
        //     console.log(response);
        //     console.log(JSON.stringify(response));
        //     console.log("환자 목록은"+response.data);
        //     setAdmList(response.data);
        //     setFetched(true);
        // })
        // .catch(err => {
        //     console.error(err);
        // })
        const fetchData = async () => {
            try {
                const username = sessionStorage.getItem('username');
                const response = await axios.get(`http://localhost:8090/wardPatientList?nurNum=`+username);
                setAdmList(response.data);
                console.log(response.data);
                setFetched(true);
            } catch (error) {
                console.error(error);
            }
        };

        fetchData();
    },[]);
    // jotai 
    // 토큰 세션스토리지에 넣으렴 .


    return (
        <>

        <div className="background">
            <div id="Lbox" style={{backgroundColor:"white"}}>
            <br/>
                <div className="boxHeader"
                >
                <img id="boxIcon" style={{marginTop:"5px", marginLeft:"15px"}} src="./img/notice.png"/>
                <h3 id="boxHeader">입퇴원 조회
                </h3>
                </div>
                <div className="searchLine">
                    <select id="status"> 
                        <option> 상태 </option>
                        <option id="wait"> 대기 중 </option>
                        <option id="ing"> 입원 중 </option>
                        <option id="exit"> 퇴원 </option>
                    </select>
                    <div className="searchbar">
                    <select id="keywordSort">
                    <option>구분</option>
                        <option>입원 번호</option>
                        <option>환자 번호</option>
                        <option>환자 이름(성별/나이)</option>
                        <option>입원 예정일</option>
                        <option>입원일</option>
                        <option>담당과</option>
                        <option>주치의</option>
                        <option>퇴원 예정일</option>
                        <option>퇴원일</option>

                        </select>&nbsp;|<input type="text"  id="keyword" placeholder=' 검색...'/>
                        <label id="searchButton" htmlFor="searchButton1"><button id="searchButton1"> </button></label>            
                    </div>

                </div>
                <br/>
                <br/>
                <br/><br/>
                <table className="admList" borderless>
                    <tr>
                        <th>입원 번호</th>
                        <th>환자 번호</th>
                        <th>환자 이름(성별/나이)</th>
                        <th>입원 예정일</th>
                        <th>입원일</th>
                        <th>담당과</th>
                        <th>담당의</th>
                        <th>병실 일련 번호</th>
                        <th>퇴원 예정일</th>
                        <th>퇴원일</th>
                        <th>상태</th>
                    </tr>
                    <tbody>
                    <tr id="line"> 
                    </tr><br/>
                    <tr>
                        <td>100401041</td>
                        <td>012491211</td>
                        <td>김동현 (남/11)</td>
                        <td>24-04-08</td>
                        <td></td>
                        <td>정신과</td>
                        <td>김진솔</td>
                        <td>20488</td>
                        <td></td>
                        <td></td>
                        <td>대기중</td>

                    </tr>
                    </tbody>
                </table>
                </div>
            </div>
            </>
    );
}
export default NurPatientList;
